import { makeStyles } from "@material-ui/core/styles";


const useStyles = makeStyles({
  appContainer: {
    background: "white",
    display: "flex",
    padding: "0px",
    borderRadius: "20px",
    width:"80%",
  },
});

const AppContainer = props => {
  const classes = useStyles(props);
  return (
    <div className={classes.appContainer}>
      {props.children}
    </div>
  )
}

export default AppContainer;
